ogseq____&quot;],536871054]],[logseq____&quot;^15logseq____&quot;,[1388,logseq____&quot;^Hlogseq____&quot;,242,536871054]],[logseq____&quot;^15logseq____&quot;,[1388,logseq____&quot;^Hlogseq____&quot;,721,536871054]],[logseq____&quot;^15logseq____&quot;,[1388,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-d975-4630-9725-e1a00ed6c853logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Flogseq____&quot;,1388,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Vlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^Ulogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1389,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-0419-4452-85fb-4db184a0554elogseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&gt; 说到赔钱，对快递员来说，赔钱是家常便饭。大多数时候是由于丢件，但也有别的情况。当时高楼金有个韵达小哥，在小区里三轮开得太快，避让一个孕妇时，车子侧翻摔倒，前挡风罩脱落碎裂。孕妇虽然没被撞到，但受了惊吓。他修车加赔偿人家花了近2000块，当即就决定辞职不干了。我还记得事后他瞪大眼和我说“我已经不干了”时心有余悸的表情，他受到的惊吓可能不比那个孕妇小。我听说过的金额最大也最离奇的赔偿，发生在临河里路的方恒东景小区。一个快递员在把快件塞进消防栓时，水管或接头被他弄坏了，水喷出来灌进电梯井里，导致电机损坏，最后赔了三万块钱。                                                                -- 摘录自 第二章logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Flogseq____&quot;,1389,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Vlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^Ulogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1390,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-3160-4465-aadc-d0ffc957fdcflogseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Flogseq____&quot;,1390,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Vlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^Ulogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1391,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-583c-4657-9113-6aa20d3506cblogseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&gt; 高楼金总共有16栋楼，其中1号楼到7号楼住的是回迁村民，8号楼到16号楼是外来的租客。回迁楼的快件都很好送，他们是本地人，白天有老人在家，即便碰到外出买菜，快件也可以放在门边或水电井里。因为村民们彼此熟识，邻里间会互相关照，连贴小广告的都不敢上去，怕被楼里的老人逮住。相对地，租客住的几栋楼就鱼龙混杂，他们大多是北漂的年轻人，有的还是合租户，白天都去上班后，屋里就没有人了。住户之间彼此不认识，楼里进出的陌生人也多，快件很容易丢失。我刚到高楼金的时候，同组的一个同事就让我送8号楼到16号楼，他自己送1号楼到7号楼。于是我每天送半个高楼金、一个新城乐居，加影视城工地，三个分开的地方来回跑，经常疲于奔命、气急败坏。\\n渐渐地，我在工作中陷入一种负面情绪里。我发现小区有的好送有的不好送，谁送了好送的别人就得送不好送的，同事之间就像零和博弈——要不就你好，要不就我好，但不能大家都好。刚来的时候，谁都是从最烂的小区送起，有的人因此走了，有的人没走。没走的人可能会换到好一点儿的小区，最后得到好送的小区的人会长久留下来，剩下不好送的小区就让新人去送。新人刚来时一般都不会太计较，但逐渐地就会察觉到其中的不公平。这种心态的转变一般只需要一两个月，甚至更短。假如迟迟没有改变的机会，新人就会离开。于是小组里总有一半的人雷打不动，另一半的人却换个不停。\\n我不想和搭档闹翻，不想难看地和他争执、讨价还价。但我也不喜欢和占我便宜的人共事。假如我每天下班比别人晚、挣钱比别人少，我就会烦躁和不满，然后变得不太在乎这份工作了。就像深海里的鱼都是瞎子、沙漠里的动物都很耐渴一样，我是一个怎样的人，很大程度上是由我所处的环境，而不是由我的所谓本性决定的。其实在当时我就已经察觉到，工作中的处境正在一点点地改变我，令我变得更急躁、易怒，更没有责任心，总之做不到原本我对自己的要求，而且也不想做到了。这些改变有时会让我觉得痛快，我痛快的时候就不太能感觉到烦躁和不满。比如有次我骂了一个不认识的妇女——我很少骂人，因此印象特别深刻。logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Flogseq____&quot;,1391,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Vlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^Ulogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1392,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-2eeb-4813-baf5-2eca029a5b9alogseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Flogseq____&quot;,1392,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Vlogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^Ulogseq____&quot;,1215,536871054]],[logseq____&quot;^15logseq____&quot;,[1393,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66969845-1eb2-48fb-99bc-2ac14942f1felogseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1394,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1394,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871054]],[logseq____&quot;^15logseq____&quot;,[1394,logseq____&quot;^Flogseq____&quot;,1393,536871054]],[logseq____&quot;^15logseq____&quot;,[1394,logseq____&quot;^Xlogseq____&quot;,1215,536871054]],[logseq____&q       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
